VALUES ('3564365045382', 'Assortiment des meilleures spécialités du Nord Coeur de guimauve, bêtises de Cambrai, nougat et babeluttes de Lys.', 'Les Rochers Nou off Nougat tendres amandes enro es de chocolat au lait et praliné. Composition : sucre, sirop de glucose, chocolat au LAIT, (cacao 33% mini), AMANDES ou NOISETTES mini), blancs d\'ŒUFS, sucre, sirop de glucose, AMANDES naturelles (15%), pain azyme (fécule de pomme de terre, eau, huile végétale) prôme vanilline. Fabriqué dans un atelier utilisant : BLE Les Perles de Genièvre Composition : matière grasse végétale s, sucre, poudre de cacao maigret pâte de cacao, lactosérum en poudre (LAIT), Genièvre fort en baie 6.5%, poudre de cacao, émulsifiant : lécithine de SOJA, vanille naturelle. Présence fortuite de FRUITS SECS à COQUES, ŒUFS, SESAME ou GLUTEN. A conserver dans un lieu frais et au sec 15/170C. Les Babeluttes des Lys Composition : sirop de glucose, sucre, LAIT écrémé concentré, beurre (LAIT), graisse végétale (huile de noix de coco entièrement hydrogénée), spéculoos (farine de blé (GLUTEN), sucret l\'huile végétale, sirop de sucre candi, poudre à lever. carbonate acide de sodium, farine de SOJA, sel, cannelle), sirop sucre candi, sel, arôme, émulsifiant lécithine de SOJA Fabriqué dans un atelier utilisant : FRUITS à COQUES. Recette de la confiserie Nougat des Lys, élaborée en Flandes Belges,', '', '10.8', '5.8', '72.8', '59.8', '', '3', '0.2', '0.078740157480315', '', '0');

